import { Box, withStyles } from "@material-ui/core";
import React, { useState } from "react";
import SubmitConfirmDialog from "./Dialog/Dialog";
import Dialog from "./Dialog/Dialog";

interface IProps {
  answers: any;
}

const Submit: React.FC<IProps> = ({ answers }) => {
  const [isOpen, setIsOpen] = useState<boolean>(false);

  const handleClose = () => {
    setIsOpen(false);
  };

  const open = () => {
    setIsOpen(true);
  };

  return (
    <>
      <Container onClick={open}>Submit</Container>
      <SubmitConfirmDialog />
    </>
  );
};

export default Submit;

const Container = withStyles({
  root: {
    backgroundColor: "#209434",
    padding: "0.5rem 2rem",
    textAlign: "center",
    fontWeight: 500,
    fontSize: "1.5rem",
    margin: "0rem 5rem 5rem 5rem",
    borderRadius: 10,
    cursor: "pointer",
    "&:hover": {
      fontWeight: 900,
      backgroundColor: "green",
    },
  },
})(Box);
